import React from 'react';


const CartIcon = () => {
    return (
        <div className='cart-icon-container'>
            <img className='cart-icon' alt='cart-icon' src='./icon.png'/>
            <span className='cart-icon-text'>0</span>
        </div>
    )
}

export default CartIcon;
